import React from 'react'

const CustomInput = ({ContainerStyles, placeholder, value, onChange, required, InputStyles, ImageSrc}) => {
    return (
        <div className={`${ContainerStyles} flex items-center border-[1.5px] border-[#348345] rounded h-[40px] w-[100%]`}>
        {IconBefore && <img src={ImageSrc}/>}
            <input
                placeholder={placeholder}
                value={value}
                onChange={onChange}
                required={required}
                className={`${InputStyles} w-[100%] h-[100%] rounded`}
            />
        </div>
    )
}

export default CustomInput
